import { Component } from "react";
import React from 'react';
import { useState,useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { Box, Stack } from "@mui/system";
import { Button, ButtonGroup } from "@mui/material";
import '../css/details.css';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import SendIcon from '@mui/icons-material/Send';
import Navbar from './Navbar';
import axios from "axios";

const Details = () => {
    const colors=["red","blue","yellow","green","blueviolet"];
    const width=window.width;
    const poid=useParams();
    const nav=useNavigate();
    let pid=poid.pid;
    const [open, setOpen] = useState(false);
    const handleClickOpen = () => {
    setOpen(!open);
    };
    const handleClose = () => {
    setOpen(false);
    };
    console.log("pid",pid);
    const api=axios.create({
        baseURL:"http://localhost:5000/custom"
    })
    // const id=useParams('id');
    const itemData = [    
        {
          img: 'https://images.unsplash.com/photo-1551782450-a2132b4ba21d'
        },
        {
          img: 'https://images.unsplash.com/photo-1522770179533-24471fcdba45'
        },
        {
          img: 'https://images.unsplash.com/photo-1444418776041-9c7e33cc5a9c'
        },
        {
          img: 'https://images.unsplash.com/photo-1533827432537-70133748f5c8'
        }
    ]
    const [preview,setPreview]=useState(itemData[0].img);
    const handleOrder=()=>{
        api.post("/order",{
            pid
        },
        {
            withCredentials:true
        }).then(res=>{
            if(res.status===200){
                
            }
            else{
                nav('/')
            }
        })

    }
    return (
        <div>  
            <Navbar/>
            <h1> Title of the Item </h1>
            <Box  className="photo-list">
                {
                    itemData.map((item)=>(
                    <div key={item.img}
                    onClick={()=>{
                        setPreview(item.img)
                    }}
                    className="details"
                    style={{
                        height:"60px",
                        width:"60px",
                        position:"relative",
                        marginTop: "10px",
                        display: "inline-block",
                        marginLeft: "5px"
                    }}
                                        >
                    <img
                        height="60px"
                        width="60px"
                        src={`${item.img}`}
                        alt={"a"}
                    />
                    </div>
                    ))
                }

            </Box>
            <div className="details" >
                <Stack direction={"row"}>
                <div className="bigPicture" style={{
                            position:"relative",
                            backgroundColor:preview
                        }}>
                        <img
                        style={{
                            height: "380px",
                            width: "380px"
                        }}
                        src={`${preview}`}
                        alt={"a"}
                    />
                    </div>
                </Stack>
                <div className="detailWords"> 
                    <h1> HP Laptop</h1>
                    <hr></hr>
                    <br></br>
                    <p>
                    RAM : 16GB /n
                    STORAGE: 1TB Hard Disk
                    Type: HP LAPTOP 
                    CPU  :Intel core i5 dual core
                    With Graphics card
                    Lorem ipsum dolor sit amet consectetur adipisicing elit. Fugit velit minus vel impedit dolor quos qui delectus?
                    Nulla minima rerum magni numquam nemo autem non quas! Ab suscipit omnis exercitationem!
                    Lorem ipsum dolor sit, amet consectetur adipisicing elit. Neque deleniti, rem adipisci illum tenetur atque ipsum. Veritatis, 
                    quis deleniti earum totam ea dolorem odio vel praesentium amet aut saepe quia?
                    Lorem ipsum dolor sit amet consectetur adipisicing elit. Quaerat, modi eos! Nesciunt a optio earum incidunt excepturi sint sapiente vitae explicabo, nobis,
                    maiores sequi assumenda adipisci, omnis voluptatem dolore eaque.
                    </p>
                </div>
            </div>

            <Button variant="contained" onClick={handleOrder} sx={{
                
                marginTop:"20px"
            }} endIcon={<SendIcon />}>
                Order
            </Button>
            <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">
          {"Use Google's location service?"}
        </DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
            Let Google help apps determine location. This means sending anonymous
            location data to Google, even when no apps are running.
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Disagree</Button>
          <Button onClick={handleClose} autoFocus>
            Agree
          </Button>
        </DialogActions>
      </Dialog>

        </div>
    );
}
export default Details;
